use std::collections::BTreeMap;

#[test]
fn test_v5_module_v1_metadata() {
    let mut h = MoveHarness::new();
    let account = h.new_account_at(AccountAddress::from_hex_literal("0xb7d68860645e7aff66895b2367686f75871601275245949da71a70befe6ffb1d").unwrap());

    let code0 = hex::decode("").unwrap();
    let code1 = hex::decode("").unwrap();
    let metadata = hex::decode("").unwrap();
    let result = h.run_transaction_payload(
        &account,
        aptos_stdlib::code_publish_package_txn(
            metadata,
            vec![code0, code1],
        ),
    );
    assert_success!(result);
}
